import { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [cartas, setCartas] = useState([]);
  const [nuevaCarta, setNuevaCarta] = useState({
    nombre: '',
    tipo: '',
    rareza: '',
    cantidad: '',
    valor: ''
  });

  useEffect(() => {
    fetch('http://localhost:5000/cartas')
      .then(res => res.json())
      .then(data => setCartas(data))
      .catch(err => console.error('Error al obtener cartas:', err));
  }, []);

  const agregarCarta = async () => {
    const { nombre, tipo, rareza, cantidad, valor } = nuevaCarta;
    if (!nombre || !tipo || !rareza || !cantidad || !valor) {
      alert('Completa todos los campos');
      return;
    }

    await fetch('http://localhost:5000/cartas', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ nombre, tipo, rareza, cantidad, valor }),
    });

    const res = await fetch('http://localhost:5000/cartas');
    const data = await res.json();
    setCartas(data);
    setNuevaCarta({ nombre: '', tipo: '', rareza: '', cantidad: '', valor: '' });
  };

  return (
    <div className="container py-5">
      <h1 className="text-center mb-4">Cartas Pok√©mon</h1>

      <div className="card p-4 shadow-sm mb-4">
        <div className="row g-2">
          <div className="col-md">
            <input
              className="form-control"
              placeholder="Nombre"
              value={nuevaCarta.nombre}
              onChange={e => setNuevaCarta({ ...nuevaCarta, nombre: e.target.value })}
            />
          </div>
          <div className="col-md">
            <input
              className="form-control"
              placeholder="Tipo"
              value={nuevaCarta.tipo}
              onChange={e => setNuevaCarta({ ...nuevaCarta, tipo: e.target.value })}
            />
          </div>
          <div className="col-md">
            <input
              className="form-control"
              placeholder="Rareza"
              value={nuevaCarta.rareza}
              onChange={e => setNuevaCarta({ ...nuevaCarta, rareza: e.target.value })}
            />
          </div>
          <div className="col-md">
            <input
              type="number"
              className="form-control"
              placeholder="Cantidad"
              value={nuevaCarta.cantidad}
              onChange={e => setNuevaCarta({ ...nuevaCarta, cantidad: e.target.value })}
            />
          </div>
          <div className="col-md">
            <input
              type="number"
              className="form-control"
              placeholder="Valor"
              value={nuevaCarta.valor}
              onChange={e => setNuevaCarta({ ...nuevaCarta, valor: e.target.value })}
            />
          </div>
          <div className="col-md-2">
            <button className="btn btn-success w-100" onClick={agregarCarta}>
              Agregar
            </button>
          </div>
        </div>
      </div>

      <div className="card shadow-sm">
        <div className="card-body">
          {cartas.length === 0 ? (
            <p className="text-muted text-center">No hay cartas registradas.</p>
          ) : (
            <table className="table table-striped table-hover">
              <thead className="table-primary">
                <tr>
                  <th>ID</th>
                  <th>Nombre</th>
                  <th>Tipo</th>
                  <th>Rareza</th>
                  <th>Cantidad</th>
                  <th>Valor</th>
                </tr>
              </thead>
              <tbody>
                {cartas.map((carta) => (
                  <tr key={carta.id}>
                    <td>{carta.id}</td>
                    <td>{carta.nombre}</td>
                    <td>{carta.tipo}</td>
                    <td>{carta.rareza}</td>
                    <td>{carta.cantidad}</td>
                    <td>${carta.valor}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
